import React from "react";
import  ReactDOM  from "react-dom";
function App(){
    ReactDOM.render(<>
        <h1>JSX Practice By using componant</h1>
        <ul>
            <li>Fist Item</li>
            <li>Second Item</li>
            <li>Third Item</li>
        </ul>
    </>);
}

export default App();
